import styled from 'styled-components';

const StyleCard = styled('div')`
    background-color: darkgrey;
    padding: 3rem;
    width: 30%;
    max-width: 15rem;
    margin: 10vh auto;
    text-align: center;
    border: 2px solid red;
    border-radius: 3px;
    border-style: solid;
    border-width: 5px;
`;

export default StyleCard;
